eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('p',[_vm._v(\"Esta é a primeira parte de uma palestra em quatro partes intitulada \\\"Computador Mundial em Sua Casa.\\\" Na primeira parte, intitulada \\\"A Ideia de um Computador Mundial,\\\" quero analisar e compartilhar minhas próprias reflexões que, em um contexto histórico mais amplo, se reuniram em torno da hashtag \\\"computador mundial.\\\"\")]),_c('p',[_vm._v(\"Para começar, vamos tentar reunir uma compreensão generalizada do que é um computador mundial, sem entrar em terminologia ou detalhes técnicos específicos. Se você pegar seu celular na mão e olhar para os ícones, poderá notar que praticamente todas as aplicações no celular têm dois segmentos principais ou áreas de operação.\")]),_c('p',[_vm._v(\"O primeiro é a parte local, ou seja, por exemplo, sua calculadora ou aplicativo de notas. Este é um aplicativo completamente local que requer quase nenhuma comunicação externa. Embora até mesmo aplicativos como o aplicativo de notas em um iPhone sejam um pouco mais do que isso, vamos nos concentrar no lado mais austero de aplicativos de código aberto para telefones Android, por assim dizer.\")]),_c('p',[_vm._v(\"A segunda parte requer infraestrutura de nuvem e aqui, quando a questão da infraestrutura de nuvem surge, uma infinidade de histórias bastante complexas começa: quem possui essa infraestrutura de nuvem, que capacidades os desenvolvedores têm para adicionar recursos a um aplicativo e, em geral, como o usuário possui esse aplicativo? Que capacidades e responsabilidades o usuário tem ao lidar com um aplicativo que não existe apenas em seu telefone, mas também em alguma infraestrutura além de seu bolso ou palma? O computador mundial é precisamente um exemplo de como a comunidade de desenvolvedores responde a essas perguntas óbvias. Perguntas óbvias sobre a criação de aplicativos de alta qualidade para seu celular, laptop, servidor e qualquer outro dispositivo inteligente que precise se conectar à rede e obter conhecimento de lá.\")]),_c('p',[_vm._v(\"O computador mundial é, consequentemente, a mesma nuvem, a mesma infraestrutura que existe na internet, com a qual os desenvolvedores podem interagir e publicar suas aplicações. Como usuário, você pode instalá-las, baixá-las e executá-las em seu PC. No entanto, com uma característica interessante e crucial: ninguém realmente possui a infraestrutura ou nuvem do computador mundial. Não há uma empresa específica, jurisdição ou indivíduo na Terra que possa determinar e dizer se você pode publicar sua aplicação lá ou não, se você tem o direito de acessar essa infraestrutura de computador mundial para receber o serviço fornecido. Portanto, o computador mundial é uma nuvem na qual qualquer desenvolvedor pode colocar sua aplicação, e qualquer usuário com acesso apenas à rede de internet e não a um endereço IP específico atrás de um firewall pode usar a aplicação pagando pelos cálculos do próprio bolso.\")]),_c('p',[_vm._v(\"Aqui está a história em um formato generalizado. Não há menção de \\\"blockchain,\\\" não há menção de \\\"contratos inteligentes,\\\" mas esses conceitos estão por baixo. Vamos ainda reconhecer: um computador mundial é uma infraestrutura de nuvem soberana, de propriedade de ninguém, permitindo que cada desenvolvedor evite a censura dos proprietários de plataformas que oferecem downloads de aplicativos. Também impede que os usuários estejam em uma situação em que não entendem como um aplicativo funciona em seu telefone. Na minha opinião, esses são recursos importantes e legais que merecem respeito e atenção daqueles que desejam criar aplicativos mais futuristas e mais legais. Isso é precisamente o que minha equipe e eu temos feito há oito anos, escolhendo talvez a área mais desafiadora - criar serviços para robótica no computador mundial, que parece estar bem na porta de sua casa, silenciosamente raspando e dizendo: \\\"Quero entrar em sua casa.\\\"\")]),_c('p',[_vm._v(\"Agora, vamos avançar para uma linha do tempo e analisar minha experiência pessoal sobre como o conceito do computador mundial evoluiu. Primeiro, vamos voltar para 2012. Este ano é notável porque o Bitcoin já existe como um serviço global de internet, acessível a todos, não de propriedade de ninguém específico. Até 2012, além do Bitcoin, começam a aparecer seus chamados forks. Um dos mais conhecidos é o Litecoin.\")]),_c('p',[_vm._v(\"O Litecoin é notável porque seu desenvolvedor fez o trabalho mais importante para toda a comunidade. Ele coletou as variáveis ou constantes configuráveis mais cruciais de diferentes partes do código do Bitcoin após o lançamento do protocolo. Isso permitiu especificar o tempo de geração de bloco, a recompensa de bloco e, estatisticamente, o Litecoin é mais frequentemente bifurcado do que o Bitcoin. Quando dizemos \\\"fork do Bitcoin,\\\" posso dizer com confiança que, na maioria dos casos, será um fork do Litecoin.\")]),_c('p',[_vm._v(\"O que o Litecoin representava naquela época era uma cópia do serviço de internet para dinheiro eletrônico. Poderia ser adicionado a \\\"rápido\\\", tornando-se dinheiro eletrônico rápido. Mais notavelmente, o surgimento de um projeto como o Namecoin.\")]),_c('p',[_vm._v(\"Namecoin também é um fork do Bitcoin e, se a memória não me falha, inicialmente foi um fork direto do Bitcoin, e então o Litecoin apareceu alguns meses depois em 2011. No entanto, o Namecoin acabou sendo um pouco diferente, abrindo caminho para muitos desenvolvedores mentalmente sobre onde as ideias subjacentes ao serviço de internet do Bitcoin poderiam evoluir. O Namecoin foi além de ser apenas uma moeda; ele poderia armazenar identidade como um banco de dados e permitir que um serviço de internet colocasse seu nome de domínio. Este foi o primeiro exemplo em que um serviço de internet originado do Bitcoin poderia ter uma natureza diferente, não apenas como o Litecoin com transações rápidas, mas a capacidade de pagar para armazenar certas informações com sua moeda interna, um token interno. Por exemplo, o nome na zona de domínio .bit.\")]),_c('p',[_vm._v(\"Desenvolvedores em todo o mundo estavam experimentando com o Bitcoin, principalmente criando forks, tornando-os mais rápidos, mais baratos eletrodomésticos. Ao lado disso, os primeiros serviços apareceram, vendo oportunidades não apenas em aplicações financeiras, mas também em aplicações interindustriais em outras áreas como o Namecoin. O Namecoin forneceu o primeiro serviço de internet globalmente acessível e não pertencente através do qual você poderia lançar seu site sem estar sob a jurisdição de uma organização específica, mas dentro de uma rede globalmente acessível e distribuída. Este momento é crucial para avançarmos para os precursores iniciais das ideias do computador mundial.\")]),_c('p',[_vm._v(\"As primeiras ideias práticas do computador mundial surgiram em 2014, dois anos após o surgimento da primeira onda de forks do Bitcoin e a criação de serviços significativos dedicados não apenas ao dinheiro eletrônico, mas também explorando temas mais amplos. Encontramos ideias que precedem o lançamento do Ethereum.\")]),_c('p',[_vm._v(\"Em 2014, em vários meetups em todo o mundo, em Miami e, eu acredito, na Europa, Vitalik Buterin articulou ideias sensatas. Ele sugere que podemos desenvolver não apenas um conjunto de serviços de internet que essencialmente funcionam como um canivete suíço, certo? Podemos desenvolver uma máquina virtual. Aqueles com formação em Ciência da Computação provavelmente se lembram do que é uma fita infinita em máquinas de Turing, e se voltarmos à teoria das máquinas computacionais, provavelmente lembramos das origens teóricas de criar nossos computadores pessoais, essencialmente a infraestrutura de servidor que temos hoje. É interessante que, cinquenta anos após o desenvolvimento da arquitetura de von Neumann e da teoria completa da máquina de Turing, e com o surgimento das tecnologias de internet apenas em 2014, e apenas após experimentos com o Bitcoin, a primeira ideia surge em nosso planeta de criar uma máquina computacional totalmente virtual baseada na mesma teoria que foi testada na indústria de ciência da computação nos últimos 50 anos. A mecânica é a mesma ao criar qualquer computador pessoal ou servidor em um data center, mas baseada mais em conquistas em tecnologias de internet e nas conquistas do mundo que mais tarde serão chamadas de Web3.\")]),_c('p',[_vm._v(\"O próprio Ethereum não é uma faca suíça, nem um conjunto de serviços específicos da internet. É, no sentido direto, uma nuvem, uma máquina computacional. O que está no seu núcleo, eu vou te contar na próxima palestra. Aqui, o mais importante para nós é focar onde a ideia do Ethereum começou. Começou com a percepção de que, em dois anos, dezenas de diferentes serviços da internet foram inventados que eram interessantes porque eram globalmente acessíveis, disponíveis sem censura para os desenvolvedores implantarem. Os usuários só podiam usá-los com uma moeda interna. No entanto, o que não era gostado em todos esses conceitos era que quase todo serviço interessante exigia sua própria infraestrutura distribuída massiva. Ao contrário dos serviços familiares da internet, você não poderia simplesmente lançar sua infraestrutura globalmente acessível se você fosse uma pessoa muito pequena ou uma equipe pequena porque tal rede seria vulnerável, e o serviço em si se tornaria inseguro. Para superar os problemas que eram efeitos colaterais ou externalidades negativas de criar seu próprio serviço de internet soberano globalmente acessível, surgiu o conceito de Ethereum. Ethereum, como uma nuvem completa capaz de lidar com qualquer computação formalizada, permite que você escreva seu código de programa, um programa completo essencialmente, e o execute na mesma blockchain ao lado de centenas de outras aplicações. Essa possibilidade, soando desde os pequenos estágios de 2014, naturalmente cativou as mentes de muitos e parecia absolutamente lógica para alguém com uma educação básica em Ciência da Computação. Se você pudesse entender o que era a completude de Turing até 2014, se você pudesse vislumbrar a teoria histórica de criar um computador pessoal, você definitivamente não ignoraria o whitepaper do Ethereum e diria que isso é exatamente o que toda a comunidade de desenvolvedores precisa.\")]),_c('p',[_vm._v(\"Acredito que o ano de 2014 e o Ethereum marcam as primeiras, embora não explicitamente nomeadas, instâncias do conceito de um computador global. Começou com a ideia de que não precisamos de uma faca suíça; em vez disso, precisamos de infraestrutura ou uma nuvem universal que aborde desafios de segurança em nível global. Os desenvolvedores, a baixo custo, deveriam ser capazes de implantar suas aplicações lá sem se preocupar com questões como garantir a rede ou criar uma rede de provedores para este computador ou seu serviço de internet específico.\")]),_c('p',[_vm._v(\"Em 2015, o Ethereum foi efetivamente lançado. A partir desse momento, mesmo até 2020, não encontrei argumentos significativos contra a ideia de criar não apenas serviços específicos da internet, mas abraçar e desenvolver o conceito de um computador virtual, servidor virtual, nuvem ou um computador global, como prefiro chamar.\")]),_c('p',[_vm._v(\"Várias variações surgem, talvez alguns se lembrem do então popular EOS sugerindo um paradigma de consumo ligeiramente diferente. Apesar da minha aversão pessoal a esse projeto, com seus 21 validadores e tudo mais, parecia suficiente para muitos. Mas introduziu a ideia de que possuir tokens lhe concede uma parte da largura de banda, o que, no âmbito da arquitetura Robonomics, permanece interessante para mim até hoje.\")]),_c('p',[_vm._v(\"Simultaneamente, surgem outras ideias sobre como modernizar a rede Ethereum. Projetos como Definity, Solana e outros entram em cena. Ao mesmo tempo, Gavin Wood apresenta o Polkadot, que ajudou Vitalik a criar o Ethereum. De uma infinidade de projetos tecnológicos entre 2015 e 2020, passamos de uma corrida para criar variantes individuais de serviços de internet para testemunhar, em um nível de protocolo de comunicação, o surgimento de algo como assassinos do Ethereum. Muitos projetos começaram sob esse slogan, levando a ideia de uma nuvem unificada para múltiplos serviços de internet e modificando alguns aspectos. Por exemplo, a EOS propôs um esquema de utilização alternativo, onde apenas a propriedade apoiada por token permitia acesso à largura de banda. Houve projetos em que a linguagem de programação para escrever código era mais interessante. Por exemplo, durante um hackathon para a BMW, quando ganhamos com uma implementação no Ethereum, a montadora imediatamente afirmou que não iríamos mais adiante a menos que tivéssemos contratos formalmente verificados, o que era impossível de alcançar no Ethereum naquela época.\")]),_c('p',[_vm._v(\"Neste momento, ao ler sobre as ideias da Eternity e de outras redes, você pode pensar: \\\"Devo tentar trabalhar com elas também.\\\" Os desenvolvedores de serviços entenderam isso, assim como, como mencionei, projetos como Definity, que lançou recentemente o World Computer e está ganhando tração. Simultaneamente, a ideia do Polkadot emerge como um framework heterogêneo de várias cadeias. O Ethereum, por volta de meados de 2010, também recebeu um roadmap para escalabilidade e desenvolvimento. Até 2024, quase todos os conceitos convergem na ideia de ter não apenas um banco de dados ou blockchain, mas uma multiplicidade. Vários métodos de processamento de transações, algoritmos de consenso de duas camadas, abordagens otimistas da maioria e uma infinidade de variações de implementação técnica surgem, todos visando o mesmo conceito de computador global.\")]),_c('p',[_vm._v(\"Vamos agora passar por um instantâneo da linha do tempo:\")]),_c('ul',[_c('li',[_c('strong',[_vm._v(\"2009-2012\")]),_vm._v(\": Surgimento do primeiro serviço de internet globalmente acessível para dinheiro eletrônico - Bitcoin. \")]),_c('li',[_c('strong',[_vm._v(\"Início de 2012\")]),_vm._v(\": A primeira guerra de forks ocorre, com projetos surgindo para replicar serviços semelhantes. Alguns projetos de vários bilhões criam seus forks. Simultaneamente, projetos como Namecoin propõem ideias interessantes.\")]),_c('li',[_c('strong',[_vm._v(\"2014\")]),_vm._v(\": O conceito de um computador mundial surge, exigindo um profundo entendimento da teoria da ciência da computação e imersão no desenvolvimento do Bitcoin.\")]),_c('li',[_c('strong',[_vm._v(\"2015-2020\")]),_vm._v(\": O conceito passa da teoria para a prática. Modificações e variações do Ethereum surgem, introduzindo ideias diferentes com diferentes graus de qualidade. O termo \\\"Computador Mundial\\\" se estabeleceu.\")]),_c('li',[_c('strong',[_vm._v(\"2024\")]),_vm._v(\": Alcançamos o Computador Mundial, um termo agora bem estabelecido, marcando a transição de uma simples calculadora em seu telefone para uma instituição globalmente acessível. A ideia do Computador Mundial engloba o dinheiro futuro, a programação do dinheiro, o armazenamento de registros de identificação e documentos importantes.\")])]),_c('p',[_vm._v(\"Em conclusão, de uma simples calculadora para uma instituição globalmente acessível, a ideia do Computador Mundial evoluiu. É visto como um lugar para o futuro do dinheiro e o armazenamento de registros vitais. O conceito de um Computador Mundial progrediu de discussões teóricas para implementações práticas de engenharia. Na próxima palestra, a discussão se aprofundará no que um Computador Mundial realmente representa. É fundamentalmente uma função de transição de estado, um conceito a ser explorado mais adiante na próxima palestra, enfatizando sua importância e a necessidade de protegê-lo.\")])])}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/pt/learn/world-computer/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

